import logo from '/src/img/artificial-intelligence.png'

function Top() {
    let css = {
        top : {
            width: '100%',
            height: '70px',
            backgroundColor: 'grey',

        },
        ul : {
            listStyleType: 'none',
            width: '450px',
            display: 'flex',
            justifyContent: 'space-between'
        }
    }

    return (
        <div style={css.top}>
            <img src={logo} alt="логотип"/>
            <ul style={css.ul}>
                <li>Home</li>
                <li>About</li>
                <li>Services</li>
                <li>Blog</li>
                <li>Contact</li>
            </ul>


        </div>
    );
}

export default Top;
